import React from 'react';
import dmx from '../common/dmx.mp3'


class Music extends React.Component {
    render() {
        return (
            <div>
                <audio src= {dmx} controls/>
                <audio src= {dmx} controls/>

            </div>
        );
    }
}


export default Music
